import React, { Component } from "react";
import { Card, Col, Row } from "react-bootstrap";
import { BrowserRouter, Route } from "react-router-dom";

import { Home, Hasil, Listcategories, Navbar } from "./components/*";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      menus: [],
    };
    console.log("menjalankan constructor");
  }

  render() {
    return (
      <div>
        <BrowserRouter>
          <Navbar />
          <div class="container">
            <Card className="p-3 my-4 border-0">
              <Row>
                <Listcategories />
                <Col md={6} mt="2">
                  <h6>
                    <strong>Daftar Produk</strong>
                  </h6>
                  <hr />
                </Col>
                <Hasil />
              </Row>
            </Card>
          </div>
          <div class="container">
            <div className="container bg-secondary text-white p-3 mt-4">
              <Route exact path="/" component={Home} />
            </div>
          </div>
        </BrowserRouter>
      </div>
    );
  }
}

export default App;
